import React from 'react'
import { useState } from 'react'
import { TransportContext } from '../Context/TransportContext';
function TransportStore({children}) {
    let [transportContext,setTransportContext]=useState([]);
  return (
    <TransportContext.Provider value={[transportContext,setTransportContext]}>
            {children}
    </TransportContext.Provider>
  )
}

export default TransportStore
